【商品説明】<br>ひと塗りで素肌力アップ！くすみ・色ムラをカバー、透明感とツヤをオン。メイクしながらたっぷりスキンケア。毛穴・小じわをカバーし、ツヤっと明るく。タバコの煙・ホコリからお肌を守る。１本で９機能（肌色補正・透明感ＵＰ・エイジングケア・毛穴ケア・乳液・美容液・クリーム・日焼け止め・化粧下地）ＳＰＦ２６ＰＡ＋＋。<br>使用方法用途など：<BR>化粧水などでお肌を整えた後、適量を手にとり、お顔全体または気になる部分に少量ずつやさしくなじませてください。その後、ファンデーション類をお使いください。落とすときはクレンジングのご使用をおすすめします。○ふんわりとした肌に仕上げたいときは、フェイスパウダーを上から重ねてください。○肌色補正下地として、ファンデーション類の前に　○首や手の甲など、くすみがちな部分もパッと明るく見せます。<br><br>成分：<BR>水、シクロベンタシロキサン、BG、メトキシケイヒ酸エチルヘキシル、酸化亜鉛、グリセリン、PEG-10ジメチコン、メタクリル酸メチルクロスポリマー、PEG-9ジメチコン、イソノナン酸イソトリデシル、ジメチコン、トリメチルシロキシケイ酸、ジステアルジモニウムヘクトライト、塩化Na、フェノキシエタノール、メチルパラベン、ハイドロゲンジメチコン、（ジメチコン/ビニルジメチコン）クロスポリマー、エチルパラベン、トコフェロール、キサンタンガム、ヒアルロン酸Na、合成サファイア、アクリル酸アルキルコポリマー、アルミナ、<br>使用上の注意：<BR>○お肌に異常が生じていないかよく注意して使用してください。○傷やはれもの・湿しん等、お肌に異常がある時はお使いにならないでください。また、使用中、赤み・はれ・かゆみ・刺激・色抜け（白斑等）・黒ずみ等の異常があらわれた場合は使用を中止し、皮フ科専門医等にご相談ください。続けてお使いになると症状を悪化させることがあります。○目に入った時は直ちに洗い流してください。<br>保管保存方法：<BR>○極端に高温または低温の場所、直射日光のあたる場所には保管しないでください。<br>保管および取扱い上の注意：<BR>○使用後は必ずしっかりとふたをしめてください。<br>原産国：日本<br>商品サイズ：90×150×20<BR><br>JANコード：4901416175626<BR>cs：48<BR><br>使用方法用途など：化粧水などでお肌を整えた後、適量を手にとり、お顔全体または気になる部分に少量ずつやさしくなじませてください。その後、ファンデーション類をお使いください。落とすときはクレンジングのご使用をおすすめします。○ふんわりとした肌に仕上げたいときは、フェイスパウダーを上から重ねてください。○肌色補正下地として、ファンデーション類の前に　○首や手の甲など、くすみがちな部分もパッと明るく見せます。<br><br>成分：水、シクロベンタシロキサン、BG、メトキシケイヒ酸エチルヘキシル、酸化亜鉛、グリセリン、PEG-10ジメチコン、メタクリル酸メチルクロスポリマー、PEG-9ジメチコン、イソノナン酸イソトリデシル、ジメチコン、トリメチルシロキシケイ酸、ジステアルジモニウムヘクトライト、塩化Na、フェノキシエタノール、メチルパラベン、ハイドロゲンジメチコン、（ジメチコン/ビニルジメチコン）クロスポリマー、エチルパラベン、トコフェロール、キサンタンガム、ヒアルロン酸Na、合成サファイア、アクリル酸アルキルコポリマー、アルミナ、<br>使用上の注意：○お肌に異常が生じていないかよく注意して使用してください。○傷やはれもの・湿しん等、お肌に異常がある時はお使いにならないでください。また、使用中、赤み・はれ・かゆみ・刺激・色抜け（白斑等）・黒ずみ等の異常があらわれた場合は使用を中止し、皮フ科専門医等にご相談ください。続けてお使いになると症状を悪化させることがあります。○目に入った時は直ちに洗い流してください。<br>保管保存方法：○極端に高温または低温の場所、直射日光のあたる場所には保管しないでください。<br>保管および取扱い上の注意：○使用後は必ずしっかりとふたをしめてください。<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
